import React from "react";
import '../App.css';

function About() {
    return (
        <>
            <div>
                <header className="App-header">
                <h1>What is HvZ?</h1>
                </header>
                <a>
                    Hello! this is the about page!
                </a>
            </div>
        </>
    );
}

export default About;
